export class TestPaletteProvider {
    constructor(palette) {
        palette.registerProvider(this);
    }

    getPaletteEntries(element) {
        return function (entries) {
            console.log(entries);
            return {
                'create.low-task': {
                    group: 'activity',
                    className: 'bpmn-icon-task red',
                    title: translate('Create Task with low suitability score'),
                    action: {
                        dragstart: createTask(SUITABILITY_SCORE_LOW),
                        click: createTask(SUITABILITY_SCORE_LOW)
                    }
                }
            };
        };
    }
}

CustomPaletteProvider.$inject = ["palette"];


export default {
    __init__: ["TestPaletteProvider"],
    testPaletteProvider: ["type", TestPaletteProvider]
};
